export class GameModel
{
    name: string;
    genre: string;
    price: number;
    releaseDate: string;

    constructor(name:string,genre:string,price:number,releaseDate:string){
      this.name = name;
      this.genre = genre;
      this.price = price;
      this.releaseDate = releaseDate;
    }

    toJSON(){
      return{
        GameName: this.name,
        GameGenre: this.GameGenre,
        GamePrice: this.GamePrice,
        GameReleaseDate: this.GameReleaseDate,
      }
    }
}
